  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115151 includes chemical,
  discrete sample, physical and profile data collected from NATHANIEL B. PALMER in
  the Indian Ocean from 1996-05-03 to 1996-07-04 and retrieved during cruise WOCE_S04I.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Partial pressure (or fugacity) of carbon dioxide, Potential temperature (theta),
  SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
  data include CTD and bottle. These data were collected by Taro Takahashi of Columbia
  University; Lamont-Doherty Earth Observatory and Frank J. Millero of Rosenstiel
  School of Marine and Atmospheric Science as part of the WOCE_S04I data set.nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
